import React, { useEffect, useRef } from 'react';
import { motion, useAnimation } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';

gsap.registerPlugin(ScrollTrigger);

const Projects = () => {
  const controls = useAnimation();
  const [ref, inView] = useInView({
    threshold: 0.2,
    triggerOnce: true,
  });

  const sectionRef = useRef(null);
  const projectsRef = useRef(null);

  useEffect(() => {
    if (inView) {
      controls.start('visible');
    }
  }, [controls, inView]);

  useEffect(() => {
    const section = sectionRef.current;
    const projects = projectsRef.current;

    // Staggered animation for project cards
    gsap.fromTo(
      projects.children,
      { y: 100, opacity: 0 },
      {
        y: 0,
        opacity: 1,
        stagger: 0.2,
        duration: 0.8,
        ease: "power3.out",
        scrollTrigger: {
          trigger: section,
          start: "top 70%",
        },
      }
    );

    return () => {
      ScrollTrigger.getAll().forEach(trigger => trigger.kill());
    };
  }, []);

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.5,
        ease: [0.43, 0.13, 0.23, 0.96],
      },
    },
  };

  const projects = [
    {
      title: "Cybersecurity Portal",
      description: "A comprehensive portal for effective management of Servers and Firewalls, providing enhanced security monitoring and control.",
      technologies: ["Python", "Figma", "VMWare Workstation", "RHEL ISO", "Round Robin ILB"],
      date: "November 2023",
      image: "/project1.jpg",
    },
    {
      title: "Cloud Shieldz",
      description: "A solution ensuring security and compliance of cloud-native applications through continuous monitoring and automated remediation.",
      technologies: ["Python", "Figma", "React.js", "Docker", "Falco", "Prometheus", "Grafana", "AWS"],
      date: "October 2024",
      image: "/project2.jpg",
    },
  ];

  return (
    <section
      id="projects"
      ref={sectionRef}
      className="py-20 md:py-32 bg-primary relative overflow-hidden"
    >
      {/* Background Elements */}
      <div className="absolute top-0 left-0 w-full h-full overflow-hidden z-0">
        <div className="absolute top-1/4 left-1/3 w-64 h-64 rounded-full bg-secondary/5 blur-3xl"></div>
        <div className="absolute bottom-1/3 right-1/4 w-80 h-80 rounded-full bg-tertiary/10 blur-3xl"></div>
      </div>

      <div className="container mx-auto px-4 md:px-6 relative z-10">
        <motion.div
          ref={ref}
          variants={containerVariants}
          initial="hidden"
          animate={controls}
          className="text-center mb-16"
        >
          <motion.h2 variants={itemVariants} className="text-2xl font-mono text-secondary mb-2">
            My Projects
          </motion.h2>
          <motion.h3 variants={itemVariants} className="text-4xl md:text-5xl font-bold">
            Recent Work
          </motion.h3>
        </motion.div>

        <motion.div
          ref={projectsRef}
          variants={containerVariants}
          initial="hidden"
          animate={controls}
          className="grid grid-cols-1 md:grid-cols-2 gap-8"
        >
          {projects.map((project, index) => (
            <motion.div
              key={index}
              variants={itemVariants}
              className="bg-tertiary/30 backdrop-blur-sm rounded-lg overflow-hidden border border-quaternary/30 hover:border-secondary/30 transition-all duration-500 transform hover:-translate-y-2 hover:shadow-xl"
            >
              <div className="relative h-48 overflow-hidden">
                <div className="absolute inset-0 bg-gradient-to-b from-primary/10 to-primary/80 z-10"></div>
                <div className="absolute inset-0 bg-gradient-to-tr from-secondary/20 to-transparent mix-blend-overlay z-10"></div>
                <div className="absolute inset-0 flex items-center justify-center bg-tertiary/50">
                  <span className="text-secondary text-xl font-bold">{project.title}</span>
                </div>
              </div>
              <div className="p-6">
                <h4 className="text-xl font-bold text-textPrimary mb-2">{project.title}</h4>
                <p className="text-textSecondary mb-4">{project.description}</p>
                <div className="mb-4">
                  <h5 className="text-sm font-semibold text-secondary mb-2">Technologies:</h5>
                  <div className="flex flex-wrap gap-2">
                    {project.technologies.map((tech, i) => (
                      <span
                        key={i}
                        className="px-2 py-1 bg-quaternary/50 text-textPrimary rounded text-xs"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>
                </div>
                <div className="flex justify-between items-center">
                  <span className="text-sm text-textSecondary">{project.date}</span>
                  <button className="text-secondary hover:underline text-sm font-mono">
                    View Details
                  </button>
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div
          variants={itemVariants}
          className="text-center mt-12"
        >
          <a
            href="https://github.com/TharunK143"
            target="_blank"
            rel="noopener noreferrer"
            className="inline-block border border-secondary text-secondary px-6 py-3 rounded font-semibold hover:bg-secondary/10 transition-colors duration-300 hover-effect"
          >
            View More on GitHub
          </a>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
